import {Link } from 'react-router-dom';
import React from 'react';
import './navigation.css';

function navigation() {
    return (
        <div id="nav">
        <Link to="/" type="button" className="nv nav-link active">Home</Link>
        <div>explore</div>
        <Link to="/create-threads" className="nv nav-link active">Get started</Link>
        <Link to="/threads" className="nv nav-link active">About-Us</Link>
        </div >
    )
}
export default navigation
